import React from "react";
import styled from "styled-components";

export default function DonationForm() {
  return (
    <MainContainer>
      <form>
        <FirstAndSecondNameContainer>
          <input type="text" placeholder="Donor First Name " />
          <input type="text" placeholder="Donor  Second Name " />
        </FirstAndSecondNameContainer>
        <input type="number" placeholder="Donor Age " />
        <GenderContainer>
          <div>
            <label>Male</label>
            <input type="radio" value="male" name="gender" />
          </div>
          <div>
            <label>Female</label>
            <input type="radio" value="female" name="gender" />
          </div>
        </GenderContainer>
      </form>
    </MainContainer>
  );
}

const MainContainer = styled.div`
  display: flex;
  flex-direction: column;
  border: 2px solid purple;
`;
const FirstAndSecondNameContainer = styled.div`
  border: 2px solid green;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;

  input {
    border: 2px solid pink;
    margin: 5px;
    padding: 3px;
    text-align: center;
  }
`;

const GenderContainer = styled.div`
  border: 2px solid crimson;
  div {
    margin: 5px;
    border: 2px solid yellowgreen;
    display: inline-block;
  }
`;
